import LinkItem from './footerlinks.style'

function FooterLinks({title, links}){
  return(
    <LinkItem>
    <p>{title}</p>
    <ul>
        {links.map((link, i) => {
          <li key={i}>
            <a href="{link.url}" rel="noopener noreferrer">{link.label}</a>
          </li>
        })}
    </ul>
    </LinkItem>
  )
}

export default FooterLinks
